import React, {useState} from 'react';
import './App.css';

function App() {

  const [value, setValue] = useState(['https://media4.giphy.com/media/EPcvhM28ER9XW/200w.webp?cid=ecf05e47z0tlbyjchwiakptjinpn0z3h9jlrtnt97jvvixl2&rid=200w.webp&ct=g'])

  return (
    <div className="App">
      <section className="App-content">
        <img src={value} />
      </section>
    </div>
  );
}

export default App;
